import React, { useEffect, useState } from 'react'
import axios from 'axios';

const Details = props => {
    const [pet, setPets] = useState({})
    useEffect(() => {
        axios.get("http://localhost:8000/pets/" )
            .then(res => setPets(res.data))
    }, [])
    return (
        <div>
           
            <h1 style = {{textAlign: "center"}}>Details about: {pet.PetName}</h1>
            <p style = {{textAlign: "center"}}>Pet type: {pet.Type}$</p>
            <p style = {{textAlign: "center"}}>Description: {pet.desc}</p>
            <p style = {{textAlign: "center"}}>Skills: </p>
            <p>{pet.skill_1}</p>
            <p>{pet.skill_2}</p>
            <p>{pet.skill_3}</p>
        </div>
      
    )
}

export default Details
